                  id="cars"
                  onChange={props.setSortingCategory}
                >
                  <option value="published">Publisert</option>
                  <option value="price_desc">Pris lav til høy</option>
                  <option value="price_asc">Pris høy til lav</option>
                </select>
              </div>
    )
}

